css:
.editor-colors {
  background-color: #f1f1f1;
  color: #212121;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #b2b2b2;
}
.editor .gutter {
  background-color: #f1f1f1;
  color: #b2b2b2;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #b2b2b2;
}
.editor .cursor {
  border-color: #20bbfc;
  border-width: 3px;
}
.editor .selection .region {
  background-color: #b6d6fd;
}
.editor .line-number.cursor-line-no-selection {
  color: #20bbfc;
}
.editor .wrap-guide {
  background-color: #d9d9d9;
}
.bracket-matcher {
  background-color: #d9d9d9;
}
.comment {
  color: #767676;
  font-style: italic;
}
/*
.entity {
  color: @blue_dark;
}*/
.storage {
  color: #008ec4;
}
.constant {
  color: #008ec4;
}
.constant.numeric,
.constant.boolean {

}@blue _darker;
.variable {
  color: #dd116f;
}
.keyword {
  color: #008ec4;
}
.operator {
  color: black;
}
.constant.support {
  color: black;
}
/*
.delimiter, .brace,
.delimiter.period,
.punctuation.definition {
  color: @black;
}*/
.invalid.deprecated {
  text-decoration: underline;
}
.invalid.illegal {
  background-color: #c30071;
  color: #ffffff;
}
.string {
  color: #dd116f;
}
